package: github.com/giantswarm/aws-operator
import:
- package: github.com/aws/aws-sdk-go
  version: master
  subpackages:
  - service/s3
  - service/elb
  - service/route53
  - awserr
- package: github.com/giantswarm/microkit
  version: 27e3ac11e763712e0d0dc5294aea8937e66458da
  subpackages:
  - command
  - error
  - logger
  - server
  - transaction
- package: github.com/go-kit/kit
  version: ~0.3.0
  subpackages:
  - endpoint
  - transport/http
- package: github.com/gorilla/mux
  version: ^1.1.0
- package: github.com/juju/errgo
- package: golang.org/x/net
  subpackages:
  - context
- package: k8s.io/client-go
  version: v2.0.0-alpha.1
- package: github.com/giantswarm/awstpr
  version: 35aee66d289de3a7e551e4accc41dbc7931410bb
- package: github.com/giantswarm/clustertpr
- package: github.com/giantswarm/certificatetpr
  version: fa554d09f0137a91aa6ef007b92e170b31dbefd2
- package: github.com/giantswarm/k8scloudconfig
  version: ab0cd3d3f87b680c38ee82335f9e086e41b3bcc7
- package: github.com/golang/protobuf
  version: 8ee79997227bf9b34611aee7946ae64735e6fd93
  subpackages:
  - jsonpb
  - proto
  - sortkeys
# The version of pflag was previously indicated by kubernetes/go-client, but using it with the current cobra version results in the following error:
# vendor/github.com/spf13/cobra/command.go:1092: c.lflags.SortFlags undefined (type *pflag.FlagSet has no field or method SortFlags)
# vendor/github.com/spf13/cobra/command.go:1092: c.Flags().SortFlags undefined (type *pflag.FlagSet has no field or method SortFlags)
# vendor/github.com/spf13/cobra/command.go:1240: c.parentsPflags.SortFlags undefined (type *pflag.FlagSet has no field or method SortFlags)
- package: github.com/spf13/pflag
  version: 2300d0f8576fe575f71aaa5b9bbe4e1b0dc2eb51
testImport:
- package: github.com/stretchr/testify
  version: v1.1.4
  repo: git://github.com/stretchr/testify.git
  subpackages:
  - assert
